    data: |
      SELECT - col2 AS col0, col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT - col1 + col2 BETWEEN + + col2 AND NULL;
  - name: tab1

outputs:
  - name: q13851.out
    data: |
      -59	59
      -68	68
      -96	96
